import React from 'react';

const Expense = () => {
  // Dummy expenses data (replace with actual data or fetch from API)
  const expenses = [
    { id: 1, description: 'Groceries', amount: 50 },
    { id: 2, description: 'Utilities', amount: 100 },
    { id: 3, description: 'Rent', amount: 800 },
    { id: 4, description: 'Entertainment', amount: 50 },
    { id: 5, description: 'Transportation', amount: 70 },
  ];

  return (
    <div className="content">
      <h2>Expenses</h2>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Description</th>
            <th>Amount</th>
          </tr>
        </thead>
        <tbody>
          {expenses.map((expense) => (
            <tr key={expense.id}>
              <td>{expense.id}</td>
              <td>{expense.description}</td>
              <td>${expense.amount}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Expense;
